import React from 'react';
import Nav from "./components/Nav";
import Home from "./components/Home";
import Portfolio from "./components/Portfolio";
import Contact from "./components/Contact";

function App() {
  return (
    <div className="App">
    	<Nav />
    	<Portfolio />
    	<Contact />
    </div>
  );
}

export default App;
